import React from 'react';
import Sidebar from './components/sidebar'
import Intro from './components/intro'
import About from './components/about'
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <div id="colorlib-page">
        <div id="container-wrap">
          <Sidebar></Sidebar>
          <Intro></Intro>
          <About></About>
        </div>
      </div>
    </div>
  );
}

export default App;
